import React from "react";

import HeroSlider from "../components/UI/HeroSlider";
import Helmet from "../components/Helmet/Helmet";

import { Container, Row, Col } from "reactstrap";
import FindCarForm from "../components/UI/FindCarForm";
import AboutSection from "../components/UI/AboutSection";
import ServicesList from "../components/UI/ServicesList";
import carData from "../assets/data/carData";
import CarItem from "../components/UI/CarItem";
import { Grid, Typography } from '@material-ui/core';

import Testimonial from "../components/UI/Testimonial";

import BlogList from "../components/UI/BlogList";

const Home = () => {
  return (
    <Helmet title="Home">
      {/* ============= hero section =========== */}
      <section className="p-0 hero__slider-section">
        <HeroSlider />
      </section>
      {/* =========== about section ================ */}
      <AboutSection />
      {/* ========== services section ============ */}
      <section>
        <Container>
          <Row>
            <Col lg="12" className="mb-5 text-center">
              <h6 className="section__subtitle">Voir nous</h6>
              <h2 className="section__title">Services</h2>
            </Col>

            <ServicesList />
          </Row>
        </Container>
      </section>
      {/* =========== car offer section ============= */}
      <section>
        <Container>
          <Row>
            <Col lg="12" className="text-center mb-5">
              <h2 className="section__title">Nos Derniers Voitures</h2>
            </Col>

            {carData.slice(0, 6).map((item) => (
              <CarItem item={item} key={item.id} />
            ))}
          </Row>
        </Container>
      </section>

      <Container className=" bg-black p-3 rounded text-center opacity-50">
        <Row  >
          <Col xs={4}>
            <h3 className="text-white"><strong>Clients: + 6</strong></h3>
          </Col>
          <Col xs={4}>
            <h3 className="text-white"><strong>Voitures : +20</strong></h3>
          </Col>
          <Col xs={4}>
            <h3 className="text-white"><strong>branches : +20</strong></h3>
          </Col>
        </Row>
      </Container>

      {/*
      <Grid container spacing={2}>
        <Grid item xs={6}>
          <Typography variant="h6">Number of Clients: +60</Typography>
        </Grid>
        <Grid item xs={6}>
          <Typography variant="h6">Numero des voitures : + 20</Typography>
        </Grid>
      </Grid>

      */}

      {/* =========== testimonial section =========== */}
      <section>
        <Container>
          <Row>
            <Col lg="12" className="mb-4 text-center">
              <h6 className="section__subtitle">Points de Vue de nos clients</h6>
              <h2 className="section__title">Temoigne</h2>
            </Col>

            <Testimonial />
          </Row>
        </Container>
      </section>

      {/* =============== blog section =========== */}

    </Helmet>
  );
};

export default Home;
